    this._checkError(this._EN.init(rptFile, outFile, unitType, headLosstype));
  }

  open(
    this: Project,
    inputFile: string,
    reportFile: string,
    outputFile: string
  ) {
    this._checkError(this._EN.open(inputFile, reportFile, outputFile));
  }

  // TODO: Include ability to have callback here
